import {useEffect, useState} from "react";
import { BrowserRouter, Routes, Route, Switch } from 'react-router-dom';
import Main from "./pages/main/Main";
import Login from "./pages/mypage/Login";
import StorageList from "./pages/storage/StorageList";
import Logout from "./pages/mypage/Logout";
import DetaileStorage from "./pages/storage/DetaileStorage";
import {authService} from "./firebase";
import MenuBar from "./components/MenuBar";
import AppRouter from "./components/Router";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [init, setInit] = useState(false);

  useEffect(() => {
    authService.onAuthStateChanged((user) => {
      if(user){
        setIsLoggedIn(user);
      } else {
        setIsLoggedIn(false);
      }
      setInit(true);
    });
  }, []);

  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          {init ?
            <AppRouter isLoggedIn={isLoggedIn} /> : "initializing......"
          }
          <Route path='/logout' element={<Logout/>}></Route>
          <Route path='/storagelist' element={<StorageList />}></Route>
          <Route path='/detailestorage' element={<DetaileStorage />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
